import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getClassroom } from "../features/classroomSlice";
import Card from "./Card";
import styles from "../styles/Dashboard.module.css";

function EnrollmentsList() {
  const classrooms = useSelector((state) => state.classroom.classrooms);
  const { userId, token } = useSelector((state) => state.auth);

  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getClassroom(token, userId));

    // eslint-disable-next-line
  }, []);

  return (
    <>
      {classrooms &&
        classrooms.map((classroom, key) => (
          <div className={styles.cards} key={key}>
            <Card name={classroom.name} teacher={classroom.teacher_name} />
          </div>
        ))}
    </>
  );
}

export default EnrollmentsList;
